function updateViewer(updateorder) {
	const $output = jQuery('#output');

	if (!images.length) {
		$output.text('no images loaded yet');
		return;
	}

	let order = jQuery('select[name="order"]').val();
	//todo, resort the image array??
	if (updateorder) {
		if (order == 'date up') {
			images.sort(function(a,b) {
				let an = a.dateraw?a.date.getTime():0;
				let bn = b.dateraw?b.date.getTime():0;
				return an - bn;
			});
		} else if (order == 'date down') {
			images.sort(function(a,b) {
				let an = a.dateraw?a.date.getTime():0;
				let bn = b.dateraw?b.date.getTime():0;
				return bn - an;
			});
		} else if (order == 'name up') {
			images.sort(function(a,b) {
				if (a.name < b.name) return -1;
				if (a.name > b.name) return 1;
				return 0;
			});
		} else if (order == 'name down') {
			images.sort(function(a,b) {
				if (a.name > b.name) return -1;
				if (a.name < b.name) return 1;
				return 0;
			});
		} else if (order == 'size up') {
			images.sort(function(a,b) {
				return a.size - b.size;
			});
		} else if (order == 'size down') {
			images.sort(function(a,b) {
				return b.size - a.size;
			});
		} else if (order == 'geo' || order == 'square') {
			updateOrder(order);
			images.sort(function(a,b) {
				return a.order - b.order;
			});
		}
	}

	let mode = jQuery('select[name="mode"]').val();
	if (mode != 'map' && map)
		destroy_map(map);
	if (window['render_'+mode])
		window['render_'+mode]($output, order);
}

