function guessLocations() {
	let done = 0;
	for (const image1 of images) {
                if (!image1.lat && image1.dateraw) {
        	        let bestimage = null;
                	let bestdist = Infinity;
	                for (const image2 of images) {
        	                if (image2.lat && image2.dateraw) {
					dist = Math.abs(image1.date.getTime() - image2.date.getTime());
        	                        if (dist < bestdist) {
	                                        bestdist = dist;
        	                                bestimage = image2;
	                                }
	                        }
        	        }
	                if (bestimage) {
				image1.square = bestimage.square;
				image1.gridref = bestimage.square; //set to square deliberately, so it only 4fig as it a 'guess'!
				image1.lat = bestimage.lat;
				image1.lng = bestimage.lng;
				done++;
			}
		}
	}
	jQuery('#message').append('guessed '+done+' locations');
	jQuery("#locations").hide('fast');
	return done;
}

