function checkHashes() {
	let done = 0;
	let todo = 0;
	if (Object.keys(hashes).length == 0) {
		jQuery('#message').append('no hashes found');
		return 0;
	}


//R.prototype.debug = function(m) { console.log(m)}

	// a dedicated function to use function closure (each check has its own creatd img object
	let hashImage = function(image) {
//		console.log('funct',image.name,image.data.length);
		let img = document.createElement("img");

		img.onload = function (event) {
			phash(img, 8).then(hash => {
	                        image.phash = hash.toHexString();
				image.done = hashes[image.phash]?hashes[image.phash]:'';

				if (!image.done) { //if no exact match, can still look for close?
					var h = Object.keys(hashes);
					var b = Infinity;
					var i = null;
					for(q=0;q<h.length;q++) {
						//store, ImageHash, so dont have decode them each time!
						let other = ImageHash.fromHexString(h[q]);
						d = hash.hammingDistance(other);
						if (d < b) {
							b = d;
							i = h[q];
						}
					}
					if (b <= 8) {
						image.close = hashes[i] + " ("+b+" bit mismatch)";
					}
				}

				done++;
				jQuery('#message').text('processed '+done+'/'+todo+' images');
				if (done == todo) {
					updateViewer();
				}
	                });
	//		img.onload = null; //not sure why, but will often call the onload even twice phash reloads the image?
		}
		img.src = image.data+"#test";
	};

        for (const image1 of images) {
                if (typeof image1.done === "undefined") {
			hashImage(image1);
			todo++;
		}
	}
	jQuery('#message').append('processing '+todo+' images');
        jQuery("#hashes").hide('fast')
	return done;
}

//////////////////////////////////////////////////
// doesnt actully reorder, just sets the 'order' property that allows to be sorted!

function updateOrder(order) {
	if (images.length < 2) {
		console.log('not enough images to sort');
		return;
	}

	//first make sure has latlng for the square
	let latn,lngn;
	if (order == 'square') {
		latn = 'slat';
		lngn = 'slng';
		for (const image of images) {
			//compute slat/slng!
			if (image.square && !image.slat) {
				let wgs84 = gridref2wgs(image.square);
				image.slat = wgs84.latitude;
				image.slng = wgs84.longitude;
			}
		}
	} else {
		latn = 'lat';
		lngn = 'lng';
	}

	let lat = 40,lng = -20; //so start 'lands end' :)
	let index = 1;
	let count = 0;

	//first count images
	for (const image of images) {
		if (image[latn])
			count++;
		image.order = 0; //need to reset, so can get progress! (also need to set even if no location, so sorting works!
	}
	if (count < 2) {
		console.log('not enough locations to sort');
		return;
	}

	//then loop looking for the next closest
	while (index <= count) {
		let bestimage = null;
		let bestdist = Infinity;
		for (const image of images) {
			if (image[latn] && image.order == 0) {
				dist = Math.pow(lat-image[latn],2)+Math.pow(lng-image[lngn],2); //dont need to bother with sqrt
				if (dist < bestdist) {
					bestdist = dist;
					bestimage = image;
				}
			}
		}
		if (bestimage) {
			bestimage.order = index;
			index++;

			lat = bestimage[latn];
			lng = bestimage[lngn];
		} else {
			//stop an infinite loop!
			return;
		}
	}
}

