function render_thumbs($output, order) {
	$output.empty();
	let $div = jQuery('<div class="grid"/>');

	let lastdate = null;
	let lastgrid = null;
	for (const image of images) {
		let broken = false;
		if (image.square && jQuery('input[name="break1km"]:checked').length) {
			if (image.square != lastgrid) {
				//append current
				$output.append($div);

				let $divid = jQuery('<div class=gridref>');
				append_square(image.square,$divid);
				$output.append($divid);
				broken = true;

				//and start another!
				$div = jQuery('<div class="grid"/>');
			}
			lastgrid = image.square;
		}

		if (image.dateraw) {
			if (lastdate && order == 'date up') {
				let diff = timediff(image.date,lastdate);
				//$tr.append(jQuery('<td>').text(image.dateraw + '(+ '+diff[1]+')'));

				if (!broken) {
					//todo, these threasholds shouldnt be hardcoded!
					if (diff[0] > 60*10 && jQuery('input[name="break10m"]:checked').length) { //seconds!
						//append current
						$output.append($div).append('<hr>');
						//and start another!
						$div = jQuery('<div class="grid"/>');
					} else if (diff[0] > 10 && jQuery('input[name="break10s"]:checked').length) { //seconds!
						//append current
						$output.append($div).append('<hr>');
						//and start another!
						$div = jQuery('<div class="grid"/>');
					}
				}
			}
			lastdate = image.date;
		}
		$div.append(jQuery('<div>').append(get_imagejQuery(image)));
	}
	$output.append($div);
}

