let map = null;
let issubmit = null;
var static_host = 'https://s1.geograph.org.uk';
let layer = null;
var layerData = new Array; //used for the MaskCanvas

function render_map($output, order) {
	//this copes even if map is already loaded, so dont empty the div
	if (!map) {
		$output.html('<div id="map"/>');

		/////////////////////
		//need to add overlayMaps FIRST, before calling setupBaseMap

		if (user_id) {
	                //stolen from Leaflet.base-layers.js - alas that file no compatible with mappingLeaflet.js at the moment :(

	                var layerAttrib='&copy; Geograph Project';
	                var layerUrl='https://t0.geograph.org.uk/tile/tile-coverage.php?z={z}&x={x}&y={y}&user_id='+user_id;
			var bounds = L.latLngBounds(L.latLng(49.863788, -13.688451), L.latLng(60.860395, 1.795260));
        	        var coverageCoarse = new L.TileLayer(layerUrl, {user_id: user_id, minZoom: 5, maxZoom: 15, attribution: layerAttrib, bounds: bounds, opacity:0.6});
	                overlayMaps["Personal Coverage"] = coverageCoarse;
		}


		if (L.GridLayer && L.GridLayer.MaskCanvas) {
			overlayMaps['Points'] = new L.GridLayer.MaskCanvas({noMask:true, radius: 2, useAbsoluteRadius: false });
			//map.addLayer(overlayMaps['Search Points']);
		}

		overlayMaps['Thumbs'] = L.photo.cluster({maxClusterRadius:80, showCoverageOnHover: true, spiderfyDistanceMultiplier: 2}).on('click', function (evt) {
			var photo = evt.layer.photo,
				template = '<img src="{thumbnail}"/><p>{caption}</p>';

			evt.layer.bindPopup(L.Util.template(template, photo), {
				className: 'leaflet-popup-photo',
				minWidth: 300
			}).openPopup();
		});

		/////////////////////

		setupBaseMap(); //creates the map, but does not initialize a view
	}

	var rows = []; //these are simple rows for clusters!
	for (const image of images) {
                if (image.lat) {
			rows.push({
				thumbnail: image.data,
				caption: image.name + ' '+ (image.rawdate || '') + ' ' + (image.square || ''),
				lat: image.lat,
				lng: image.lng
			});
			layerData.push([image.lat,image.lng]);
		}
	}

	if (rows) {
		overlayMaps['Thumbs'].add(rows);

		map.fitBounds(overlayMaps['Thumbs'].getBounds(), {maxZoom:18});

		if (overlayMaps["Personal Coverage"])
			overlayMaps["Personal Coverage"].addTo(map);

		if (overlayMaps['Points']) {
			overlayMaps['Points'].addTo(map);
			overlayMaps['Points'].setData(layerData);
		}

		overlayMaps['Thumbs'].addTo(map);
	}
}

function destroy_map() {
	map.remove();
	map = null;
	layer = null;
}

