// utility rendering - used by multiple views!

function append_timebreaks(diff, $tbody) {
	//todo, these threasholds shouldnt be hardcoded!
	if (diff[0] > 60*10 && jQuery('input[name="break10m"]:checked').length) { //seconds!
		$tbody.append(jQuery('<tr>').append(jQuery('<td colspan=5 class=divider>&nbsp;')));
	} else if (diff[0] > 10 && jQuery('input[name="break10s"]:checked').length) { //seconds!
		//add this immidately to tbody, and wil be BEFORE THIS row. 
		$tbody.append(jQuery('<tr>').append(jQuery('<td colspan=5 class=divider>')));
	}
}

function append_square(gridref, $ele) {
	let $near = jQuery('<span>');
	let $text = jQuery('<div>');
	get_gridref(gridref, function(gridrow) {
		if (gridrow && gridrow.Place)
			$near.text('near '+gridrow.Place+', '+gridrow.County+', '+gridrow.Country);
		if (gridrow && gridrow.imagecount)
			$text.text(''+gridrow.imagecount+' images currently');
		if (usercache[gridref])
			$text.append(', you have submitted '+usercache[gridref]+' images in this square');
	});
	var url = "https://www.geograph.org.uk/gridref/"+gridref;
	$ele.append(jQuery('<h3>').append(jQuery('<a>').text(gridref).attr('href',url).attr('target','_blank')).append(' ').append($near));
	$ele.append($text);
}

function append_submitted(image, $td) {
	//assume get_usercache already called
	let key = image.square+':'+image.dateraw.substr(0,10).replace(/-/g,'');
	//var url = "https://www.geograph.org.uk/gridref/"+image.square+"?user="+user_id;
	var url = "https://www.geograph.org.uk/search.php?do=1&displayclass=black&user_id="+user_id+"&gridref="+image.square+"&distance=1";
	if (usercache[key]) {
		url = url + "&taken="+image.dateraw.substr(0,10);
		$td.append(' ').append(jQuery('<a class=nowrap>').attr('target','_blank').text(usercache[key]+' images on that day').attr('href', url));
	} else if (usercache[image.square]) {
		$td.addClass('not-submitted');
		$td.append(' ').append(jQuery('<a class=nowrap>').attr('target','_blank').text(usercache[image.square]+' images in square').attr('href', url));
	} else
		$td.addClass('not-submitted');
}

function get_imagejQuery(image) {
	let title = image.path?image.path:image.name;
	if (image.dateraw)	title = title + " " + image.dateraw;
	if (image.square)	title = title + " " + image.square;
	if (jQuery('input[name="square"]:checked').length) {
		//blank alt, is just because will be displayed as text, if no src!
		return jQuery('<img class="square" alt="">').css('background-image','url('+image.data+')').attr('title',title);
	} else {
		return jQuery('<img>').attr('src',image.data).attr('title',title).attr('width',image.width).attr('height',image.height); //width/height are the size of origiona, but we setting because want to allow aspect-ratio, see will display much smaller!
	}
}

function submit_image(image) {
	var reader = new FileReader();
	reader.onload = function (e) {

		jQuery('#message').html('<form method=post action="/submit-receive.php" target=submit>');
		let $form = jQuery('#message form');

		$form.append('<input type=hidden name="src">');
		$form.append(jQuery('<input type=hidden name="auto">').attr('value', jQuery('select[name="method"]').val()));

		$form.append(jQuery('<input type=text name="lat">').attr('value',image.lat || image.slat));
		$form.append(jQuery('<input type=text name="lng">').attr('value',image.lng || image.slng));

		//if too big, need to first size to under 8Mb!
		if (image.size > 8388608) {
			alert('image is too big to submit right now. We hope to add support for resizing soon!');
			return;

			var img = document.createElement("img");
			//NOTE, while we know a easy way to resize using canvas, it WONT retain EXIF.
			// https://github.com/nodeca/pica (already in imagehash)
			// + https://github.com/nodeca/image-blob-reduce might be a solution!
			img.onload = function (event) {
				//jQuery('#message form input[name="src"]').val(e.target.result);
				//form.submit(); //..so user doesnt actlly have to press the button!
			}
			img.src = e.target.result;

		//otherwise can send directly (although probably too big for GET, so needs a post!
		} else {
			//because the URL is long, add it directly to the element, rather than creating in jquery obj in memory first
			jQuery('#message form input[name="src"]').val(e.target.result);

			$form.trigger("submit"); //..so user doesnt actlly have to press the button!
			$form.hide();
		}

		$form.append('<button type=submit>Submit to Geograph</button>');
	};
	reader.readAsDataURL(image._file);
}

