// general functions

function timediff(d1,d2) {
	let seconds = (d1.getTime()-d2.getTime())/1000;
	if (seconds > 24*60*60)
		return [seconds, Math.round(seconds / (24*60*60) ) + " days"];
	if (seconds > 60*60)
		return [seconds, Math.round(seconds / (60*60) ) + " hours"];
	if (seconds > 60)
		return [seconds, Math.round(seconds / 60) + " minutes"];
	return [seconds, Math.round(seconds) + " seconds"];
}


let gridcache = {};
function get_gridref(gridref, callback) {
	if (gridcache[gridref]) {
		callback(gridcache[gridref]);
		return;
	}
	jQuery.getJSON('https://api.geograph.org.uk/stuff/square.json.php?gridref='+encodeURIComponent(gridref), function(result) {
		if (result && !result.error) {
			gridcache[gridref] = result[0];
			callback(gridcache[gridref]);
		}
	});
}

let usercache = {};
let hashes = {};
function get_usercache(callback) {
	if (hashes_url) {
		jQuery.getJSON(hashes_url, function(result) {
			usercache = {}; //reset it, in case edit user_id!
                        for(let q=1;q<result.length;q++) { //skip the FIRST rwo - it effectively a header row!
				//[19,"f","f51b6bd41a239660","SH6644","2004-06-02","Looking Down on Llyn Stwlan"],
				//  0  1    2                   3           4             5
				let row = result[q];
                                let key = row[3]+':'+row[4].replace(/-/g,''); //grid+date (sphinx dates dont have dashes)
				usercache[key] = usercache[key]?usercache[key]+1:1;
                                key = row[3]; //just square
				usercache[key] = usercache[key]?usercache[key]+1:1;
				//todo, add jsut day?

				if (row[2]) //todo, store as actual hash obects so can do hemmingdistance easier
					hashes[row[2]] = row[0]+" "+row[5];
			}
			if (callback)
	                        callback();
		});
		return;
	}

	//older version before hashes
	let where = encodeURIComponent('user_id='+user_id);
	jQuery.getJSON("https://api.geograph.org.uk/api-facetql.php?select=id,grid_reference,takenday,count(*)+as+images&where="+where+"&group=grid_reference,takenday&order=id+desc&limit=1000",function(result) {
		if (result && !result.error && result.rows) {
			usercache = {}; //reset it, in case edit user_id!
			for(let q=0;q<result.rows.length;q++) {
				let row = result.rows[q];
				let key = row.grid_reference+':'+row.takenday;
				row.images = parseInt(row.images); //to make sure adds, rather than string concat
				usercache[key] = row.images;
				key = row.grid_reference;
				usercache[key] = usercache[key]?usercache[key]+row.images:row.images;
			}
			jQuery('#message').text('loaded '+result.rows.length+' trips for user '+parseInt(user_id));
			if (result.rows.length == 1000)
				jQuery('#message').append(', possible data is truncated');
		}
		if (callback)
			callback();
	});
}

